(1, 25, 0, '晤久', 'upload/20181102/2018110216592528066500.png', '张医生, 您好！本病具体如何治疗的，激素你们如何增减，免疫抑制剂你们用环磷酰胺吗？效果如何？', '[]', 1541149597, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
(2, 26, 0, '丽芳姐', 'upload/20181102/2018110217072049241100.png', '张老师好，激素后期如何减量，一些患者最后几粒很难减去，如何避免及处理？', '[]', 1541149692, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
(4, 27, 0, '真心喂了狗', 'upload/20181102/2018110217085249270100.png', '张医生，您好！请问本病激素治疗的指征，冲击治疗如何减药停药，无效时换什么药？谢谢！', '[]', 1541149776, '123.112.155.0', '', 1, 1, 0, '', 'User:20181102_20181102144853851937008669,', 2, 2, 1),
(5, 28, 0, 'PFC李博士', 'upload/20181102/2018110217100792672600.png', '您好，张医生，单纯眼肌型重症肌无力，适合多大量的激素，有一例单纯左眼睑下垂患者，口服强的松从 30 mg 逐渐加至 60 mg，疗程 2 周，效果欠佳，是怎么回事，请予以指导。', '[]', 1541149840, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
(6, 29, 0, '期待圆梦', 'upload/20181102/2018110217112391978800.png', '请问张医生，激素治疗获得最优效果后需要维持多久呢？', '[]', 1541149930, '123.112.155.0', '', 1, 1, 1, '[{"id":"2018110217434307295300","sayState":2,"nickname":"\\u5176\\u4ed6\\u5730\\u533a\\u7f51\\u53cb","avatar":"assets\\/images\\/defaultAvatar.jpg","contents":"\\u56de\\u590d\\u671f\\u5f85\\u5706\\u68a6\\uff1a\\u540c\\u6837\\u95ee\\u9898\\uff0c\\u5e0c\\u671b\\u56de\\u590d\\u4e00\\u4e0b\\uff0c\\u8c22\\u8c22","honor":"","state":2,"time":1541151823}]', 'User:20181102_20181102144853851937008669,', 2, 2, 1),
(7, 30, 0, '为梦想努力', 'upload/20181102/2018110217124503148800.png', '请教张医生，胸腺瘤术后激素怎么减量，我们那边专家是主张快速减量，可我遇见好几个病人快速减量后症状又出现的。谢谢！', '[]', 1541150066, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
(8, 31, 0, '你是我的一切', 'upload/20181102/2018110217150504177900.png', '您好，张医生，眼肌型三年，吃了中药和新斯的明，症状缓解多久可以停药呢？有停药的可能吗？', '[]', 1541150153, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
(9, 0, 0, '其他地区网友', 'assets/images/defaultAvatar.jpg', '请问张医生，肌无力已经严重影响到了我的日常生活，现在自己也非常担心，现在想要知道，这个要怎么治疗？谢谢', '[]', 1541150192, '123.112.178.33', '', 0, 1, 0, '', '', 2, 2, 1),
(10, 32, 0, '英雄联盟', 'upload/20181102/2018110217212105450700.png', '张医生，您好！请问在诊所如果条件有限，仅凭病史、症状、体征和疲劳试验，能不能确诊 MG？还有，GC 冲击疗法，有没有一个统一的方案？谢谢！', '[]', 1541150490, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
(11, 33, 0, '紫萱', 'upload/20181102/2018110217222449160000.png', '尊敬的张老师，患者，男性，67 岁，视物成双 1 周。查体：左侧上睑下垂。晨轻暮重，疲劳试验阳性。肌电图示左侧眼睑肌低频衰减明显。用溴吡斯的明 60 mgtid3 天，无效。因为出现腹痛等药物反应停用。改为激素使用将近 1 月后，症状有所好转出院。MG 对新斯的明没有反应吗？是不是抗 MUSK 抗体阳性的 MG 类型？', '[]', 1541150570, '123.112.155.0', '', 1, 1, 0, '', 'User:20181102_20181102172048176131005241,', 2, 2, 1),
(12, 34, 0, '过去就过去了', 'upload/20181102/2018110217250448802700.png', '尊敬的医生，60 岁女 15 年 1 月全身型患者胸腺瘤术后出现危象。2 月份好转后仅左睑下垂，7 月左睑垂好转、出现右睑下垂。请问 1. 分型是按发病时分型还是动态分型，需要多长时间稳定期可以重新分型？2.7 月份的变化算加重，还是无变化？3. 现在治疗是口服强的松 15 mgQD、溴吡斯的明 60 mgtid 合适吗？', '[]', 1541150732, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
(13, 35, 0, '在细雨中呼喊青春', 'upload/20181102/2018110217291587520400.png', '张医生，对于青年女性重症肌无力患者，是否可生产？怀孕期间应如何调整药物？', '[]', 1541151003, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
(14, 36, 0, '迎接尾声2018', 'upload/20181102/2018110217320387570300.png', '请问张医生重症肌无力诊断中自身抗体的检测目前抗原种类有无增加，抗体检测的趋势如何？谢谢！', '[]', 1541151148, '123.112.155.0', '', 1, 1, 0, '', 'User:20181102_20181102144853851937008669,', 2, 2, 1),
(15, 37, 0, '一壶酒足矣', 'upload/20181102/2018110217350101501600.png', '尊敬的张老师，单纯眼征型需要治疗吗？就只有左眼睑下垂 10 年时间了。', '[]', 1541151327, '123.112.155.0', '', 2, 1, 0, '', 'User:20181102_20181102144853851937008669,User:20181117_20181117170641651832006442,', 2, 2, 1),
(16, 38, 0, '秋叶', 'upload/20181102/2018110217390902654400.png', '尊敬的张老师，MG 患者长期服用硫唑漂粼出现副作用比如粒细胞抑制和掉头发以后，还能继续服用吗？', '[]', 1541151574, '123.112.155.0', '', 2, 1, 0, '', 'User:20181102_20181102144853851937008669,User:40,', 2, 2, 1),
(17, 39, 0, '当初遇你', 'upload/20181102/2018110217414903612700.png', '张医生，请教几个问题：1. 溴吡斯的明效果良好患者，需要一直服用还是减药停药？', '[]', 1541151719, '123.112.155.0', '', 2, 1, 0, '', 'User:40,User:20181102_20181102144853851937008669,', 2, 2, 1),
(18, 25, 0, '晤久', 'upload/20181102/2018110216592528066500.png', '谢谢，张医生，辛苦', '[]', 1541151835, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
