(111, 45, 0, '光学透镜-李', 'upload/20181109/2018110917151190534300.png', '你好，高医生。上了年纪的我，经常头晕是怎么回事？都是起床后，开始犯头疼或者坐后站起来的时候出现头晕，一会就好，这是怎么回事，害怕会有一天突然晕，再也看不到亲人，这很严重吗，有没有治疗的办法？', '[]', 1543655742, '222.131.7.136', '', 0, 1, 0, '', '', 2, 2, 1),
