(116, 48, 0, '家香', 'upload/20181109/2018110917281248602600.png', '高医生，头痛,头晕,呕吐后稍好片刻又复发；不能进食喝水,每天失眠,伴右腿坐骨神经痛,身体动则加重.每月发作三四次,已将两年病史.能治好吗？', '[]', 1543656131, '222.131.7.136', '', 0, 1, 1, '[{"id":"2018120117565463344500","sayState":2,"nickname":"\\u5168\\u56fd\\u8111\\u75c5\\u4e13\\u5bb6\\u8fdc\\u7a0b\\u4f1a\\u8bca\\u5e73\\u53f0","avatar":"upload\\/20180911\\/2018091115353051494600.jpg","contents":"\\u56de\\u590d \\u5bb6\\u9999\\uff1a\\u4f60\\u597d\\uff0c\\u4e3b\\u4efb\\u6b63\\u5728\\u8bb2\\u89e3\\u4f60\\u7684\\u95ee\\u9898\\uff0c\\u8bf7\\u7559\\u610f\\u3002","honor":"\\u5b98\\u7f51","state":2,"time":1543658214}]', '', 2, 2, 1),
