(134, 0, 1, '全国脑病专家远程会诊平台', 'upload/20180911/2018091115353051494600.jpg', '直播已经开始啦。邀请王氏中医第八代传人、精神疾病诊疗专家王玉堂为大家讲解“多梦易醒，得了失眠怎么办 ”，如果您有关于“失眠”的问题， 可以通过直播在线提问，也可以拨打官方电话010-83980777 进行详细咨询。', '[]', 1544259947, '123.112.164.167', '官网', 0, 1, 0, '', '', 2, 2, 1),
(135, 44, 0, 'cover', 'upload/20181109/2018110917131202433900.png', '王大夫，我长期心情不好，并伴有腿疼,一直持续了五六年，时常熬夜到凌晨一两点才睡，第二天还要早起正常工作，精神不好。然后有次聚会，就睡不着了，睡眠质量非常不好，有时还很难入睡,医生。失眠吃药能好吗？帮我解答一下，十分感谢！', '[]', 1544260416, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
