(139, 81, 0, '爱丽丝', 'upload/20181208/2018120817291386642300.png', '王医生，我做IT,我神经衰弱；一年多了；经常失眠;就是经常做恶梦；易醒；晚上醒来好几次；每次都是做梦醒的；第二天起来很累；头昏昏沉沉；没有精神；严重的健忘；精神不集中；想请教医生，这是什么原因？', '[]', 1544261390, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
(140, 82, 0, '心有阳光', 'upload/20181208/2018120817313105988000.png', '尊敬王医生，您好，现在我己停药有十多天了，每晚都能很快入睡，但最近几天早醒，四点半左右就被小便涨醒就不好再睡了，我每晚十点半至十一点就睡着了，吃药时能睡到8小时。请问王医生我还要吃药吗？', '[]', 1544261533, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
(142, 57, 0, '妮妮', 'upload/20181117/2018111717130591488100.png', '我31岁机关公务员。平时晚上睡觉对于自己来说简直是在受刑，因为经常处于入睡难、易醒、多梦的状态，清早起床眼睛肿胀，并且觉得特别累。从而影响心情也很烦躁。请问：这是怎么回事？医生，能帮解答一下，快，着急。', '[]', 1544261607, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
(143, 83, 0, '好未来需努力', 'upload/20181208/2018120817333100659800.png', '王大夫，我妈是糖尿病神经病变，抑郁失眠，她的腿十分难受，总是感觉抹了辣椒水的感觉，而且十分沉重，一动就累。我妈这种情况该怎么办呢？', '[]', 1544261626, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
(147, 84, 0, '口香糖╮', 'upload/20181208/2018120817390547801500.png', '孩子从4月底开始，情绪有些烦躁，睡眠不好，入睡困难，心情不好。5月中旬我们把孩子从学校接回家调养。5月底带孩子去北京广安门中医院进行治疗，检查后，医生面诊说是抑郁症状，舍曲林干预治疗。服药1个月，孩子情绪有好转，有时还会觉得烦躁。跟孩子商量后，决定找王主任治疗。想让您帮孩子制定一个治疗方案，让孩子尽快摆脱抑郁失眠的困扰，心情开阔起来，早日回到学校正常学习。谢谢', '[]', 1544262166, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
(148, 85, 0, '爱你第一眼', 'upload/20181208/2018120817451015204300.png', '我父亲今年8月初查出患有食道癌。再进行放疗，次数已达23次,我父亲现在的反应是身体疲倦无力,睡眠易醒(过去也是这样),嗓子有些疼痛,停止输液2天感觉更痛,但他情绪上有些焦躁和悲观.我该平常要注意哪一些，让他安心睡觉！减少他痛苦。', '[]', 1544262317, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
