(157, 65, 0, '千寻', 'upload/20181117/2018111717330489214300.png', '我老公做童装生意，今年开始转型做电商。从10月开始就经常失眠，本以为活动结束能好，没想到现在12月了一直睡不好，睡着了有点声音就醒。婆婆说吃百乐眠胶囊管用，是真的么？能长期吃药吗？谢谢，医生', '[]', 1544262802, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
(158, 49, 0, '太阳花', 'upload/20181109/2018110917292386798800.png', '失眠已经20年了，一直都靠吃药才能睡觉。7年前患了抑郁，失眠更严重，开始吃抑郁的药，情绪波动很大，胸口经常闷堵，之前检查的时候说是轻度抑郁，前几天看了医生说我是癔症。前几天心情很差，这几天好多了，想找王医生再看看，希望能找到对我的长期失眠和抑郁的治疗方法。', '[]', 1544262818, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
(159, 0, 0, '沈阳网友', 'assets/images/defaultAvatar.jpg', '王医我患有精神分裂症，并伴有失眠，如何治愈', '[]', 1544262865, '175.167.152.12', '', 0, 1, 1, '[{"id":"2018120817582738057300","sayState":2,"nickname":"\\u5168\\u56fd\\u8111\\u75c5\\u4e13\\u5bb6\\u8fdc\\u7a0b\\u4f1a\\u8bca\\u5e73\\u53f0","avatar":"upload\\/20180911\\/2018091115353051494600.jpg","contents":"\\u56de\\u590d \\u6c88\\u9633\\u7f51\\u53cb\\uff1a\\u533b\\u751f\\u5728\\u56de\\u7b54\\u4f60\\u7684\\u95ee\\u9898\\uff0c\\u8bf7\\u60a8\\u7559\\u610f\\uff01","honor":"\\u5b98\\u7f51","state":2,"time":1544263107}]', '', 2, 2, 1),
(160, 62, 0, '如柒', 'upload/20181117/2018111717260588183900.png', '谢谢你，医生', '[]', 1544262966, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
(161, 62, 0, '如柒', 'upload/20181117/2018111717260588183900.png', '医生，岳母上个月突发心梗去世了，老婆天天以泪洗面，她这一个月来晚上睡不着，睡一会就醒，好几次半夜坐在床上哭。吃百乐眠胶囊不行，医生，有哪些快速入睡的方法？', '[]', 1544263091, '123.112.164.167', '', 0, 1, 0, '', '', 2, 2, 1),
(162, 0, 1, '全国脑病专家远程会诊平台', 'upload/20180911/2018091115353051494600.jpg', '直播已经结束，如果您有精神疾病的相关问题，可点击【权威专家】咨询在线专家，也可拨打电话010-83980777，和专家一对一沟通。', '[]', 1544263379, '123.112.164.167', '官网', 0, 1, 0, '', '', 2, 2, 1),
(163, 0, 0, '保定网友', 'assets/images/defaultAvatar.jpg', '我从15岁时，上到初三没毕业就患上了精神分裂症，我不承认我有病，住河北省第六人民医院住过4次，喝了氯氮平还是一夜无眠，有两次心动过速的副作用发生，王奎星主任给我治疗过，我是10月25日出的院。现在喝完药很短时间就睡着，但是脑子糊涂了，情绪心情不好，紧张，焦虑，半夜醒，这都是药物反应吗？能治好吗？', '[]', 1544268598, '183.198.206.107', '', 0, 1, 0, '', '', 2, 2, 1);
INSERT INTO `mv_comments_1` (`id`, `uid`, `admins`, `nickname`, `avatar`, `contents`, `file`, `time`, `ip`, `honor`, `up`, `top`, `reply`, `replyJson`, `upJson`, `show`, `reShow`, `noSay`) VALUES
(164, 0, 1, '全国脑病专家远程会诊平台', 'upload/20180911/2018091115353051494600.jpg', '直播已经开始啦。直播中医世家、中医脑病诊疗专家刘胜利为大家讲解“中西医结合治疗重症肌无力之针药联合 ”，如果您有关于“重症肌无力”的问题， 可以通过直播在线提问，也可以拨打官方电话010-83980776 进行详细咨询。', '[]', 1544778053, '123.112.186.11', '官网', 0, 1, 0, '', '', 2, 2, 1),
(165, 87, 0, '点点滴滴', 'upload/20181214/2018121417073793918700.png', '医生你好，我是一名妈妈，我家孩子19岁，得了重症肌无力，全身乏力，而且平时吃饭也没有力气，现在只能吃一点稀饭，或者是喝点牛奶，补充体力。吃了药时好时坏，请问医生，孩子这种情况该怎么办？[em_5]', '[]', 1544778532, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(166, 88, 0, '辣妈就是我', 'upload/20181214/2018121417103014331600.png', '我同事的老公在前段时间检查出重症肌无力。以前听说得这种病的人活不了多长时间，我想问一下重症肌无力能活十年吗？', '[]', 1544778659, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(167, 88, 0, '辣妈就是我', 'upload/20181214/2018121417103014331600.png', '我挺心疼我同事的，希望能找到有效的治疗方法，给他们一线希望。刘医生一定帮我解答。坐等刘医生。', '[]', 1544778772, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(168, 89, 0, '宝贝不哭', 'upload/20181214/2018121417145749877800.png', '我婶婶是重症肌无力患者，她孩子也患了肌无力，我想知道孩子怎么会得这种病，这是遗传性疾病吗?', '[]', 1544778963, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(169, 90, 0, '再见小時候', 'upload/20181214/2018121417170218421600.png', '我女朋友不幸得了重症肌无力，我想问一下主任，她的得了重症肌无力还能生育吗?', '[]', 1544779107, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(170, 90, 0, '再见小時候', 'upload/20181214/2018121417170218421600.png', '我们很着急  心里头一直有块石头压着 ，主任一定要给我们解答，谢谢主任了。', '[]', 1544779174, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(171, 91, 0, '家是我的一切', 'upload/20181214/2018121417204149836800.png', '我34岁，已经有4个月感觉头部总是立不起来，得用双手托扶才行，犯病总是晨起轻，下午重，是重症肌无力吗?要做哪些检查？', '[]', 1544779272, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(172, 92, 0, '联盟', 'upload/20181214/2018121417243790579200.png', '我是重症肌无力患者，呼吸困难，精神异常，食欲差，睡眠差，体重减轻。针灸能治好吗，或者有什么比较省钱的方法？', '[]', 1544779488, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(173, 93, 0, '糊涂', 'upload/20181214/2018121417274707861000.png', '我的表妹快12岁了，患了重症肌无力，引起眼部肌肉异常，现在在服用溴吡斯的明片，虽然效果还好，但不能停药，一停症状就会变的严重。药物治疗能换针灸治疗吗，我们担心药物伤害器官。', '[]', 1544779703, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(174, 0, 0, '唐山网友', 'assets/images/defaultAvatar.jpg', '主任您好:孩子今年19岁总是说听到有人骂他，要打他，在17年6月份去医院就诊，吃氨磺必利，巴戟天，舍曲林，做了脑神经植入治疗，状态稳定了一个月由于停药再次说有人说他要打他，非常恐慌，后来再次就诊继续吃药，但是状况不是很好，因此不工作，在月17年10份改吃阿力', '[]', 1544779909, '106.119.31.140', '', 0, 1, 0, '', '', 2, 2, 1),
(175, 81, 0, '爱丽丝', 'upload/20181208/2018120817291386642300.png', '儿童女，重症肌无力，7岁眼肌型，当时的药是左卡泥丁口服液和强的松。现在又复发了，药效不好，需要加药量吗？', '[]', 1544780097, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(177, 94, 0, '爱情来敲门', 'upload/20181214/2018121417365414674000.png', '请问喉肌型重症肌无力能治好吗？ 说话时间太长后就说不出来，一晒太阳，眼皮抬不起来，脸部通红，没精神想睡觉，严重时连喝水都喝不进去，吃溴吡斯的明三个月了，这种情况是不是很严重，能治好吗？', '[]', 1544780242, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(178, 86, 0, '无名之辈', 'upload/20181214/2018121417071890801000.png', '我20岁结婚，家住甘肃武威农村，生育一男一女，无家族疾病史，最初为上肢无力、眼睛无力睁不开，后来发展为下肢无力，迈步、吃东西、说话困难，无法参加任何劳动，不疼有酸涨感，请问医生良药良方，十分感谢。', '[]', 1544780314, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(179, 84, 0, '口香糖╮', 'upload/20181208/2018120817390547801500.png', '你好，医生，是什么引起重症肌无力的呢？孩子才13岁。最近需要按住眉毛，眼睛才能够睁开，听朋友说可能是上眼皮肌无力所导致，想问一下，对于这种情况应该怎样进行治疗？日常该注意些什么？', '[]', 1544780383, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(180, 95, 0, '抓住努力的尾巴', 'upload/20181214/2018121417405414484400.png', '我现在才十八岁，可是我出现了上眼睑中度提肌无力的现象，这种病得花多长时间才能治好？我能治好吗，我想回去上学？', '[]', 1544780481, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(181, 96, 0, '落日桥头细感风', 'upload/20181214/2018121417420150250800.png', '我是重症肌无力患者，该吃什么食物能够调理疾病？', '[]', 1544780561, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(182, 83, 0, '好未来需努力', 'upload/20181208/2018120817333100659800.png', '我患重症肌无力已有5年了，现在的症状是上睑下垂、复视、四肢无力，拿笔不稳，肌肉萎缩、吞咽困难。药物进行治疗效果好还是针灸治疗好？', '[]', 1544780610, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(183, 97, 0, '追着太阳跑', 'upload/20181214/2018121417480189813900.png', '前段时间我发现，手臂肌肉非常疼痛无力，回家拿不起筷子，休息后我的症状也没有好转，这是怎么回事？能继续做建筑的工作吗？麻烦医生了。', '[]', 1544780900, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(184, 98, 0, '慢慢坚强', 'upload/20181214/2018121417495388473000.png', '有重影，昏头胀脑，疲倦成感，严重时右眼皮下坠，呼吸气短。就是重肌，应吃什么药。', '[]', 1544781018, '123.112.186.11', '', 1, 1, 0, '', 'User:20181220_20181220130501604150001550,', 2, 2, 1),
(185, 72, 0, '微笑面对', 'upload/20181121/2018112119093412781300.png', '15年9月18号左右突发性右眼球上飘移位，视物明显异常！左眼下垂，无重影。检查过磁共振、血清以及抗乙酰胆碱突触前后膜、胸腺瘤抗体都正常！请问我这重症肌无力严重吗？', '[]', 1544781076, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(186, 99, 0, '勤学好问', 'upload/20181214/2018121417552949782900.png', '女儿于今年9月20号左右，右眼球突发性向上翻，眼球不在同一条线上，无重影，无复视！视物不舒服。左眼睑有点下垂，身体没症状。医生怀疑是重症肌无力，现在该怎么办？', '[]', 1544781357, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(187, 100, 0, '守住⒈份堅持，一路平安', 'upload/20181214/2018121417573091274500.png', '我是重症肌无力导致左眼神经麻痹外斜视，左眼眼球向右转动受限制，自己能控制看东西在一个平行线，但是很模糊，也很累，这种病情以持续两年，现在服用嗅吡斯的明，一天三次，一次六片，中药是活血化淤的药，同时在针灸，都坚持十多天了也没见什么效果，想问下，针灸会有效？', '[]', 1544781466, '123.112.186.11', '', 0, 1, 0, '', '', 2, 2, 1),
(189, 0, 1, '全国脑病专家远程会诊平台', 'upload/20180911/2018091115353051494600.jpg', '直播已经结束，如果您有精神疾病的相关问题，可点击【权威专家】咨询在线专家，也可拨打电话010-83980776，和专家一对一沟通。', '[]', 1544781839, '123.112.186.11', '官网', 0, 1, 0, '', '', 2, 2, 1),
(190, 0, 0, '菏泽网友', 'assets/images/defaultAvatar.jpg', '精神分裂怎么治疗', '[]', 1545383012, '27.206.145.123', '', 0, 1, 0, '', '', 1, 2, 1),
(191, 0, 1, '全国脑病专家远程会诊平台', 'upload/20180911/2018091115353051494600.jpg', '直播已经开始啦。直播邀请精神疾病诊疗专家于平华主任为大家讲解“有强迫症状就一定是强迫症吗 ”，如果您有关于“精神疾病”方面的问题， 可以通过直播在线提问，也可以拨打官方电话010-83980777 进行详细咨询。', '[]', 1545383052, '123.112.157.166', '官网', 0, 1, 0, '', '', 2, 2, 1),
(192, 41, 0, '佽╮嶶笶', 'upload/20181109/2018110916554088986700.png', '于医生，我儿子35岁，男，有强迫症的病史，他老感觉双眼疼痛有异物感，一直在抠自己的眼睛，从来没有停止，医院检查发现他双眼有眼睑炎，角膜混浊，右边的眼睛已经没有光感，双侧视神经萎缩。请问医生，有没有办法停止？再下去要瞎了，求助医生帮忙，非常感谢', '[]', 1545383744, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(193, 42, 0, '红罗褥', 'upload/20181109/2018110917075412948200.png', '你好，医生。我性格内向，凡事要求完美，好钻牛角尖。从事财务工作，回家很少说话。16年末开始失眠，遇事就想，走路经常习惯回头看，反复检查账，怕出错。我这是强迫症吗？我讨厌这样的自己，怎么能改变？', '[]', 1545383842, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(194, 43, 0, '敏敏', 'upload/20181109/2018110917105648549800.png', '于医生，我丈夫老是重复看一样东西，眼睛看还看不清，大脑反应和眼睛看得慢半拍，筷子没放好继续摆，不停摆，鞋放没放好，一整天不停整鞋架，坐便冲完看了又看，东西放那也得看好多次等等。这样下去，生活乱得很。我应该带他去看什么科？帮我解答一下，谢谢', '[]', 1545383935, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(195, 82, 0, '心有阳光', 'upload/20181208/2018120817313105988000.png', '我患强迫症已有6年，我不想吃药，都说“是药三分毒”我也觉得吃多了那些药会影响智力，请问医生有没有其他办法？', '[]', 1545383981, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(196, 101, 0, '走向未来', 'upload/20181221/2018122117200548145200.png', '你好，于医生。我总是会这样，比如穿什么衣服，吃什么东西总要犹豫几个小时。如果我想玩游戏或者干其他事，则没有那么犹豫。从我上高一起有这个现象的，后来感觉越来越严重，6年过去，生活中还会有这样的烦心事，这是怎么回事？能改掉吗？', '[]', 1545384060, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(197, 99, 0, '勤学好问', 'upload/20181214/2018121417552949782900.png', '于医生，我害怕别人的口水溅到自己碗里，20多年来从不和家人一起吃饭，双手怕脏从不接触任何东西，家里从不锁门，进出家门要用脚踢门，而且每天洗澡要洗6到7个小时，一年四季都用冷水。我家人老说我有病，是真的吗？', '[]', 1545384108, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(198, 102, 0, '唯有自己强大', 'upload/20181221/2018122117221504663600.png', '请问医生，总喜欢盯着朋友的错不放，一定要他改正，怎么办？什么原因会这样？他们都不爱搭理我了。是不是责任心太强导致的这种强迫症?', '[]', 1545384160, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(199, 104, 0, '奋斗赎青春', 'upload/20181221/2018122117320947841200.png', '于医生，我现在21岁了，走在路上都感觉好怕，总感觉有人要陷害我，只要在路上有人看我一眼，我就觉得那个人不是好人，只要有几个人在旁边说话，我都觉得那是在讨论我。我现在每天都过得很累。我这是怎么了？', '[]', 1545384748, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(200, 105, 0, '无畏向前', 'upload/20181221/2018122117325821687700.png', '你好，于医生。家里有强迫症患者，男，他不能自理，强迫症很严重，饮食上有什么方法可以改善吗？有什么禁忌吗？', '[]', 1545384812, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(201, 106, 0, '低调的爆发', 'upload/20181221/2018122117344700475500.png', '于医生，我29岁，有严重强迫症，把家里的衣服都洗烂了，手也流血，一直很压抑，不知道怎么办，不想去医院，请问医生有没有建议？', '[]', 1545384908, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(202, 107, 0, '屹立在这世上', 'upload/20181221/2018122117392701938200.png', '于医生，你好。大概从小学开始，已经8年以上了。特别明显的是锁门习惯性数数字，特别不放心。这样子出去的速度经常拖拉。衣服要叠得整整齐齐的，怎样才能完全改掉强迫症？', '[]', 1545385188, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(203, 108, 0, '冲刺 最后的希望', 'upload/20181221/2018122117401412037400.png', '你好，医生。明年就高考了，现在加上严重的强迫注意力固着，非常痛苦，我以前对咳嗽声注意，现在对痒痒、小动作很在意，都很痛苦，又转到嘴里总是不断的生出口水，一咽就会思路全打乱，不咽也很难受都能流出来了，很痛苦，不知道怎么办了?', '[]', 1545385238, '123.112.157.166', '', 1, 1, 0, '', 'User:20181228_20181228172534182646004008,', 2, 2, 1),
(204, 109, 0, '飘逸@', 'upload/20181221/2018122117410588867100.png', '医生，你好。我现在的强迫症极度严重了，我想结婚前治好，我之前吃帕罗西丁停了4次了，不敢在吃了，就怕毒副作用太大，帕罗西丁能治愈强迫症吗？', '[]', 1545385288, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(205, 110, 0, '几分壮志豪情', 'upload/20181221/2018122117461815713100.png', '于医生，我强迫症16年，今年上大一，已休学看病，医生先让我早上吃两片丁螺环酮和两片百忧解，中午吃两片丁螺环酮，晚上吃半片再普乐，等症状缓解后再心理治疗，请问这样合理吗，会有什么副作用？', '[]', 1545385612, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(206, 111, 0, '要想成功，必须强大', 'upload/20181221/2018122117472216570500.png', '于医生，我从初中二年级患上强迫症，比如有时候一直盯着自已的鼻子看，控制不住；难以控制自已进行正常的思考。对学习有很大的影响，家里人不能理解；至今已有13个年头了，我这样的病症是否必要服用西药？需要终身服药吗？', '[]', 1545385686, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(207, 42, 0, '红罗褥', 'upload/20181109/2018110917075412948200.png', '谢谢，我听得很清楚，我会主动去改变，会改正', '[]', 1545386159, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(209, 111, 0, '要想成功，必须强大', 'upload/20181221/2018122117472216570500.png', '好的，于医生，谢谢你', '[]', 1545386427, '123.112.157.166', '', 0, 1, 0, '', '', 2, 2, 1),
(210, 0, 1, '全国脑病专家远程会诊平台', 'upload/20180911/2018091115353051494600.jpg', '直播已经结束，如果您有精神疾病的相关问题，可点击【权威专家】咨询在线专家，也可拨打电话010-83980777，和专家一对一沟通。', '[]', 1545386468, '123.112.157.166', '官网', 0, 1, 0, '', '', 2, 2, 1),
(211, 0, 1, '全国脑病专家远程会诊平台', 'upload/20180911/2018091115353051494600.jpg', '直播已经开始啦。直播邀请邀请精神疾病诊疗专家王奎星主任为大家讲解“冬天抑郁高发季，该如何治疗调理”，如果您有关于“精神疾病”方面的问题， 可以通过直播在线提问，也可以拨打官方电话010-83980777 进行详细咨询。', '[]', 1545987620, '123.112.156.40', '官网', 0, 1, 0, '', '', 2, 2, 1),
(214, 82, 0, '心有阳光', 'upload/20181208/2018120817313105988000.png', '开始直播了', '[]', 1545987750, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(215, 0, 0, '其他地区网友', 'assets/images/defaultAvatar.jpg', '精神分裂症能治吗？需不需要住院？多长时间能治好', '[]', 1545987875, '113.2.34.100', '', 0, 1, 0, '', '', 2, 2, 1),
(217, 26, 0, '丽芳姐', 'upload/20181102/2018110217072049241100.png', '你好，王大夫。女 28岁，甲亢高发抑郁症，我已经有1年的自杀倾向了。平时对啥都很自卑，不爱交流，有的事情做过之后很内疚的，因为脾气比较爱挑刺和别人不容易相处。我能吃安眠药品麻痹神经吗？实在不想面对生活。', '[]', 1545988011, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(218, 31, 0, '你是我的一切', 'upload/20181102/2018110217150504177900.png', '老婆生孩子1个月了，感觉她不开心，经常乱发脾气，不知道是不是有抑郁症了，产后抑郁后果会很严重吗，我害怕孩子哭起来没办法兼顾到她，她会不会出事？', '[]', 1545988190, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(220, 32, 0, '英雄联盟', 'upload/20181102/2018110217212105450700.png', '我孩子15岁，一直闹着要离家出走，这是不是青春期的叛逆？他说他最近失恋了，心情压抑，学不好，压力大。我们要怎么开导他？不能这样下去！', '[]', 1545988564, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(221, 84, 0, '口香糖╮', 'upload/20181208/2018120817390547801500.png', '我的孩子20岁，男性，很容易发怒，冲动，只要不合他的意就发火，已经缀学在家了，整天玩电脑游戏，都不和我们沟通，也不愿意出门，生活懒散，成天抱着游戏。他为什么会这样？', '[]', 1545988952, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(222, 83, 0, '好未来需努力', 'upload/20181208/2018120817333100659800.png', '我亲戚女, 31岁,孩子老人先后离开人间，她压抑，成天对着孩子照片，流泪。医生，经常头痛，视力模糊，幻觉。朋友相劝，被她狠狠赶出去。有时候不想活下去。我们该怎么帮她？', '[]', 1545989023, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(223, 113, 0, '要学会放下', 'upload/20181228/2018122817241506316700.png', '胡思乱想是抑郁症吗？我总爱胡思乱想，而且很没自信心，连我自己都讨厌自己。这是不是有抑郁症啊？', '[]', 1545989062, '123.112.156.40', '', 1, 1, 0, '', 'User:20181231_20181231102632213231004763,', 2, 2, 1),
(224, 114, 0, '释放吧，青春', 'upload/20181228/2018122817281507452800.png', '我亲戚女 31岁,孩子老人先后离开人间，她压抑，成天对着孩子照片，流泪。医生，经常头痛，视力模糊，幻觉。朋友相劝，被她狠狠赶出去。有时候不想活下去。我们该怎么帮她？', '[]', 1545989301, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(225, 115, 0, '踩着梦,飞翔', 'upload/20181228/2018122817294189262400.png', '抑郁症，焦虑症，强迫症。情绪低落，睡眠不好。吃盐酸文拉法辛缓释片和阿普唑仑片，一天一次，一次一粒，最近注意力和记忆力都下降了 。 是吃药导致的吗？', '[]', 1545989389, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(226, 116, 0, '我不哭,有你', 'upload/20181228/2018122817304308060100.png', '最近老是感觉胃里不舒服想吐的感觉，晚上这情况比较多，中午吃药后感觉胃里凉凉的。用药情况，中午（丙戊酸镁两片，西酞普兰1.5片）晚上（丙戊酸镁两片，西酞普兰1.5片）奎硫平0.2g的1片。是药物的副作用吗？需要调整用药吗', '[]', 1545989448, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(227, 117, 0, '夜幕降临', 'upload/20181228/2018122817322849398900.png', '我老婆，去年8月份生的孩子，后来慢慢的出现头晕头疼的症状。尤其晚上严重，最近他说他心里老有事情放不下事的，现在他说大脑有时也不受控制，去医院检查说是血管痉挛，在家输液输了两天越输越头晕，前天去中医那看了看说是产后抑郁症。我想在想确认是不是产后抑郁症？', '[]', 1545989559, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(228, 0, 0, '广州网友', 'assets/images/defaultAvatar.jpg', '王主任，手术可以治疗抑郁症吗？', '[]', 1545989579, '121.32.69.48', '', 0, 1, 0, '', '', 2, 2, 1),
(229, 118, 0, '小骄傲，起来前进', 'upload/20181228/2018122817343101631200.png', '抑郁症，服药情况：上午：文拉法欣一片；晩上：米氮平1片，奥氮平半片，氯硝西泮半片。现在食欲减退，性欲减退、大便不正常、睡不好，晚上经常做恶梦，情绪低落，其他基本正常。可否减药？', '[]', 1545989678, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(230, 0, 0, '广州网友', 'assets/images/defaultAvatar.jpg', '王主任，请问抑郁症的治疗都有哪些方法？', '[]', 1545989741, '121.32.69.48', '', 0, 1, 1, '[{"id":"2018122817403463014500","sayState":2,"nickname":"\\u5168\\u56fd\\u8111\\u75c5\\u4e13\\u5bb6\\u8fdc\\u7a0b\\u4f1a\\u8bca\\u5e73\\u53f0","avatar":"upload\\/20180911\\/2018091115353051494600.jpg","contents":"\\u56de\\u590d \\u5e7f\\u5dde\\u7f51\\u53cb\\uff1a\\u4e3b\\u4efb\\u6b63\\u5728\\u89e3\\u7b54\\u60a8\\u7684\\u95ee\\u9898\\uff0c\\u8bf7\\u60a8\\u7559\\u610f","honor":"\\u5b98\\u7f51","state":2,"time":1545990034}]', '', 2, 2, 1),
(231, 119, 0, '奋斗不止', 'upload/20181228/2018122817362513444700.png', '最近老是感觉胃里不舒服想吐的感觉，晚上这情况比较多，中午吃药后感觉胃里凉凉的。用药情况，中午（丙戊酸镁两片，西酞普兰1.5片）晚上（丙戊酸镁两片，西酞普兰1.5片）奎硫平0.2g的1片。是药物的副作用吗？需要调整用药吗', '[]', 1545989831, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(232, 29, 0, '期待圆梦', 'upload/20181102/2018110217112391978800.png', '我老婆，去年8月份生的孩子，后来慢慢的出现头晕头疼的症状。尤其晚上严重，最近他说他心里老有事情放不下事的，现在他说大脑有时也不受控制，去医院检查说是血管痉挛，在家输液输了两天越输越头晕，前天去中医那看了看说是产后抑郁症。我想在想确认是不是产后抑郁症？', '[]', 1545990002, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(233, 74, 0, 'look me', 'upload/20181124/2018112417210550044600.png', '抑郁症，服药情况：上午：文拉法欣一片；晩上：米氮平1片，奥氮平半片，氯硝西泮半片。现在食欲减退，性欲减退、大便不正常、睡不好，晚上经常做恶梦，情绪低落，其他基本正常。可否减药？', '[]', 1545990088, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(235, 73, 0, '漫天尘埃中的微笑', 'upload/20181124/2018112417175690072200.png', '孩子老是说心口窝有块石头压着，堵的，高兴不起来，哀声叹气，入睡时间长，不想动，不想和人说话。 劳拉西泮睡前半小时吃1片，如半小时后还不能入睡，吃酒石酸唑吡坦片四分之一片或半片。药量会不会有点大，这个药有依赖性吗？吃药期间需要化验或检查吗？', '[]', 1545990282, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(236, 34, 0, '过去就过去了', 'upload/20181102/2018110217250448802700.png', '孩子高中时夏天发病，偏头疼，失眠，说话声音变大且话多，记忆力下降，脑血管痉挛。高中期间吃过一瓶多虑平，休学3月，后考入985工程大学。大一病情缓和，今年大三加重。我们现在该怎么办？', '[]', 1545990315, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(237, 35, 0, '在细雨中呼喊青春', 'upload/20181102/2018110217291587520400.png', '医生你好！我孩子今年16岁读高二每天都沉默寡言，家里的人问他高兴就回答，不高兴就不理彩。这种情况正常吗？', '[]', 1545990360, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(238, 0, 0, '其他地区网友', 'assets/images/defaultAvatar.jpg', '谢谢，王主任', '[]', 1545990393, '121.32.69.48', '', 0, 1, 0, '', '', 2, 2, 1),
(240, 69, 0, '暖暖', 'upload/20181117/2018111717510705504400.png', '医生，您好。我按照医嘱早餐后舍曲林50mg，睡前是阿普唑仑半片和曲唑酮25mg。睡眠有所改善，但是白天明显感觉头晕，嗜睡，影响生活和工作，而且感觉情绪较前低落。我想请问您一下，这样的情况是否需要换药或者调整剂量。谢谢您。', '[]', 1545990590, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(241, 100, 0, '守住⒈份堅持，一路平安', 'upload/20181214/2018121417573091274500.png', '大夫，我查了心电图和超生心动，没问题，现在也没有出不开气的这症状了，情绪也挺好的，还坚持服用一片半百忧解，但是近几个月月经推迟，而且这次肚子疼得厉害和我服用百忧解有关系吗？还是我着凉引起的？', '[]', 1545990617, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(242, 0, 0, '广州网友', 'assets/images/defaultAvatar.jpg', '如果长期应用药物治疗，对身体有没有影响？我们该怎么去避免这些副作用呢？有没有好的方法，希望王主任解答', '[]', 1545990651, '121.32.69.48', '', 0, 1, 0, '', '', 2, 2, 1),
(244, 99, 0, '勤学好问', 'upload/20181214/2018121417552949782900.png', '上周三初诊开了百适可，服药四天时咽痛低烧，第五天低烧没退，今天第六天，请问是否需要停药？感冒药和百适可能一起吃吗？', '[]', 1545990756, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(245, 103, 0, '你若盛开，蝴蝶自来', 'upload/20181221/2018122117231820323600.png', '医生您好！25豪克文拉法辛刚开始吃人会觉得累吗？会想睡觉吗？这个药一般是在什么时候吃的？今天下午我女儿吃了一颗。觉得累。想睡觉。没关系吗？', '[]', 1545990941, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(246, 102, 0, '唯有自己强大', 'upload/20181221/2018122117221504663600.png', '大夫，我查了心电图和超生心动，没问题，现在也没有出不开气的这症状了，情绪也挺好的，还坚持服用一片半百忧解，但是近几个月月经推迟，而且这次肚子疼得厉害和我服用百忧解有关系吗？还是我着凉引起的？', '[]', 1545991102, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(247, 0, 0, '杭州网友', 'assets/images/defaultAvatar.jpg', '你好，王主任  我今年34岁吃药有十几年了，服用的是绿氮平每天晚上吃一片零半片、舒必利每天晚上1片，现在睡觉状态良好这个能逐渐减停药物吗？', '[]', 1545991145, '223.104.246.76', '', 0, 1, 1, '[{"id":"2018122818010665819600","sayState":2,"nickname":"\\u5168\\u56fd\\u8111\\u75c5\\u4e13\\u5bb6\\u8fdc\\u7a0b\\u4f1a\\u8bca\\u5e73\\u53f0","avatar":"upload\\/20180911\\/2018091115353051494600.jpg","contents":"\\u56de\\u590d \\u676d\\u5dde\\u7f51\\u53cb\\uff1a\\u4e3b\\u4efb\\u6b63\\u5728\\u56de\\u7b54\\u4f60\\u7684\\u95ee\\u9898\\uff0c\\u8bf7\\u7559\\u610f","honor":"\\u5b98\\u7f51","state":2,"time":1545991266}]', '', 2, 2, 1),
(249, 69, 0, '暖暖', 'upload/20181117/2018111717510705504400.png', '谢谢，医生，我听得很明白', '[]', 1545991234, '123.112.156.40', '', 0, 1, 0, '', '', 2, 2, 1),
(250, 0, 1, '全国脑病专家远程会诊平台', 'upload/20180911/2018091115353051494600.jpg', '直播已经结束，如果您有精神疾病的相关问题，可点击【权威专家】咨询在线专家，也可拨打电话010-83980777，和专家一对一沟通。', '[]', 1545991408, '123.112.156.40', '官网', 0, 2, 0, '', '', 2, 2, 1);
INSERT INTO `mv_comments_10` (`id`, `uid`, `admins`, `nickname`, `avatar`, `contents`, `file`, `time`, `ip`, `honor`, `up`, `top`, `reply`, `replyJson`, `upJson`, `show`, `reShow`, `noSay`) VALUES
(1, 25, 0, '晤久', 'upload/20181102/2018110216592528066500.png', '张医生, 您好！本病具体如何治疗的，激素你们如何增减，免疫抑制剂你们用环磷酰胺吗？效果如何？', '[]', 1541149597, '123.112.155.0', '', 0, 1, 0, '', '', 2, 2, 1),
