(52, 58, 0, '祥凌', 'upload/20181117/2018111717142215917500.png', '你好，刘晓蕊医生，我是一名女性患者，头脑突然发晕，左身发麻，记忆力明显下降，2014年2月，脑右侧胶质密度低，引起继发性癫痫，现在服用丙戊酸钠卡马西平 每天一次 一次各一片 ，不知是不是心理因素， 疗效不显著，请问医生我这样的情况现在要怎么办？', '[]', 1542446189, '123.112.182.147', '', 0, 1, 0, '', '', 2, 2, 1),
(53, 59, 0, 'い花落恋伊人', 'upload/20181117/2018111717172617622800.png', '刘晓蕊医生，你好。女性癫痫患者在怀孕期间可以吃药吗?', '[]', 1542446306, '123.112.182.147', '', 0, 1, 0, '', '', 2, 2, 1),
(55, 61, 0, '形影不离。', 'upload/20181117/2018111717200549092200.png', '你好，刘晓蕊医生，我现在怀孕了，每天在吃药，但是我担心对孩子不利，我要需要减少药物吗？还要注意些什么？', '[]', 1542446716, '123.112.182.147', '', 0, 1, 1, '[{"id":"2018111717482297894100","sayState":2,"nickname":"\\u5168\\u56fd\\u8111\\u75c5\\u4e13\\u5bb6\\u8fdc\\u7a0b\\u4f1a\\u8bca\\u5e73\\u53f0","avatar":"upload\\/20180911\\/2018091115353051494600.jpg","contents":"\\u56de\\u590d \\u5f62\\u5f71\\u4e0d\\u79bb\\u3002\\uff1a\\u4f60\\u597d\\uff0c\\u4e3b\\u4efb\\u6b63\\u5728\\u8bb2\\u89e3\\u4f60\\u7684\\u95ee\\u9898\\uff0c\\u8bf7\\u7559\\u610f\\u3002","honor":"\\u5b98\\u7f51","state":2,"time":1542448102}]', '', 2, 2, 1),
(56, 0, 0, '北京网友', 'assets/images/defaultAvatar.jpg', '癫痫很久啦，真的能彻底治好吗，女士生，初中就癫痫晕倒过很多次', '[]', 1542446740, '123.112.174.129', '', 0, 1, 0, '', '', 2, 2, 1),
(57, 62, 0, '如柒', 'upload/20181117/2018111717260588183900.png', '刘晓蕊医生，你好。我是一名女性，三年前患上癫痫病，一直采取药物治疗病情时好时坏药物换了好多种现在病情基本稳定，一般半年左右发作一次，好像每次发作前都有征兆，有时轻有时重，癫痫这种疾病能彻底治愈吗？', '[]', 1542446793, '123.112.182.147', '', 0, 1, 0, '', '', 2, 2, 1),
(58, 0, 0, '北京网友', 'assets/images/defaultAvatar.jpg', '癫痫治疗差不多之后多久能停药啦，会不会复发？', '[]', 1542446868, '123.112.174.129', '', 0, 1, 1, '[{"id":"2018111717451854388600","sayState":2,"nickname":"\\u5168\\u56fd\\u8111\\u75c5\\u4e13\\u5bb6\\u8fdc\\u7a0b\\u4f1a\\u8bca\\u5e73\\u53f0","avatar":"upload\\/20180911\\/2018091115353051494600.jpg","contents":"\\u56de\\u590d \\u5317\\u4eac\\u7f51\\u53cb\\uff1a\\u4f60\\u597d\\uff0c\\u4e3b\\u4efb\\u6b63\\u5728\\u8bb2\\u89e3\\u4f60\\u7684\\u95ee\\u9898\\uff0c\\u8bf7\\u7559\\u610f\\u3002","honor":"\\u5b98\\u7f51","state":2,"time":1542447918}]', '', 2, 2, 1),
(59, 63, 0, '海澜', 'upload/20181117/2018111717270548844400.png', '你好，刘医生。女儿15岁患有癫痫病，最近这段时间女儿好好的就会出现手脚抽搐的症状，以前从来没有过，最多持续一段时间的头晕，现在手脚抽搐的次数还变多了，发作起来非常痛苦，我想知道，这病对我女儿，会产生哪些危害呢？', '[]', 1542446890, '123.112.182.147', '', 0, 1, 0, '', '', 2, 2, 1),
(61, 64, 0, '娘娘', 'upload/20181117/2018111717284224663000.png', '你好，刘晓蕊医生，我是一名女学生，2016年时，因为一场车祸，大脑开过手术，现在患上癫痫，发病时间3个月前。平时表现的容易烦躁不安，记忆力、理解能力、表达能力不好。四肢动作不能够很好的协调支配。突然的就会发病，大声的尖叫、口吐白沫，翻白眼脸色苍白、全身抽搐。请问我该做什么检查？', '[]', 1542447128, '123.112.182.147', '', 0, 1, 1, '[{"id":"2018111717415420488600","sayState":2,"nickname":"\\u5168\\u56fd\\u8111\\u75c5\\u4e13\\u5bb6\\u8fdc\\u7a0b\\u4f1a\\u8bca\\u5e73\\u53f0","avatar":"upload\\/20180911\\/2018091115353051494600.jpg","contents":"\\u56de\\u590d \\u5a18\\u5a18\\uff1a\\u4f60\\u597d\\uff0c\\u4e3b\\u4efb\\u6b63\\u5728\\u8bb2\\u89e3\\u4f60\\u7684\\u95ee\\u9898\\uff0c\\u8bf7\\u7559\\u610f\\u3002","honor":"\\u5b98\\u7f51","state":2,"time":1542447714}]', '', 2, 2, 1),
(62, 66, 0, '忘怀1314', 'upload/20181117/2018111717355348629000.png', '刘晓蕊医生，你好，女朋友在昨天忽然就神志不清，口吐白沫手脚抽搐。去医院检查才发现我的女朋友患有癫痫。那么，我女朋友为什么会出现这样疾病？', '[]', 1542447377, '123.112.182.147', '', 0, 1, 1, '[{"id":"2018111717391662867300","sayState":2,"nickname":"\\u5168\\u56fd\\u8111\\u75c5\\u4e13\\u5bb6\\u8fdc\\u7a0b\\u4f1a\\u8bca\\u5e73\\u53f0","avatar":"upload\\/20180911\\/2018091115353051494600.jpg","contents":"\\u56de\\u590d \\u5fd8\\u60001314\\uff1a\\u4f60\\u597d\\uff0c\\u4e3b\\u4efb\\u6b63\\u5728\\u8bb2\\u89e3\\u4f60\\u7684\\u95ee\\u9898\\uff0c\\u8bf7\\u7559\\u610f\\u3002","honor":"\\u5b98\\u7f51","state":2,"time":1542447556}]', '', 2, 2, 1),
